### Summary of Core Topics, Concepts, Principles, and Equations

#### Core Topics and Concepts

1. **Software Testing Fundamentals**
   - **Graph Coverage Criteria**: Node coverage, edge coverage, edge-pair coverage, prime path coverage.
   - **Finite State Machines (FSM)**: State coverage, equivalence to graph coverage criteria.
   - **Predicate Logic**: Understanding predicates, conditions, and logical operators (e.g., \( \neg, \land, \lor \)).

2. **Requirement Analysis**
   - **Types of Requirements**: Business requirements, usability requirements, non-functional requirements, regulatory requirements.

3. **Partition Testing**
   - **Equivalence Class Partitioning**: Identifying partitions and their properties (complete, disjoint).
   - **Boundary Value Analysis (BVA)**: Selecting test inputs at the boundaries of partitions.

4. **Integration Testing**
   - **Top-Down Approach**: Use of test stubs and test drivers.

5. **Base Choice Coverage (BCC)**
   - **Partition Blocks**: Understanding base choice and additional tests required for coverage.

6. **Control Flow Graphs (CFG)**
   - **Vertices and Edges**: Understanding the structure and coverage criteria (e.g., edge coverage, edge-pair coverage).
   - **Linearly Independent Paths**: Calculating the number of independent paths in a CFG.

7. **Concolic Testing**
   - **Symbolic Execution**: Path constraints, equivalence classes, and concrete test inputs.
   - **DART (Directed Automated Random Testing)**: Generating path constraints and test inputs.

8. **Logical Predicates and Coverage**
   - **RACC, GICC, RICC Pairs**: Understanding and identifying these pairs in truth tables.
   - **CNF and DNF**: Conjunctive Normal Form and Disjunctive Normal Form.

#### Important Equations and Logical Expressions

1. **Predicate Logic**
   - \( p = \neg a \lor (b \land c) \)
   - \( p = (a \land b) \lor (\neg a \land b) \lor (p \land \neg q) \)
   - \( p = (a \land c) \lor \neg b \)

2. **Path Constraints**
   - \( \bigwedge_{i \in [0, n-1]} (r_i \geq 0) \land (r_n < 0) \)
   - \( (a_0 > c_0), (b_0 \cdot b_0 - 4 \cdot a_0 \cdot c_0 \leq 0) \)

3. **Boundary Value Analysis**
   - For a partition \( 0 \leq score \leq 120 \), test inputs include boundary values and values outside the partition: \( \{-3, 0, 30, 40, 120, 125\} \).

4. **Equivalence Class Partitioning**
   - For CGPA ranges, identify partitions based on the given rules:
     - 4.0 to 7.9
     - 8.0 to 8.4
     - 8.5 to 8.9
     - 9.0 to 9.4
     - 9.5 to 10.0

